package assemble

import org.scalatest._
import utils.ReadFrom
import org.assertj.core.api
import scala.collection.JavaConverters._

class DeBruijnGraphSpec extends FlatSpec with Matchers with ReadFrom {

  "graph" should "be calculated" in {
    val k = 4
    val genome="AAGATTCTCTAC"

    val graph = createGraph(k, genome).toList.sorted
    val expected = "AAG -> AGA\n     AGA -> GAT\n     ATT -> TTC\n     CTA -> TAC\n     CTC -> TCT\n     GAT -> ATT\n     TCT -> CTA,CTC\n     TTC -> TCT".split("\n").map(_.trim).toList
    api.Assertions.assertThat(graph.asJava).containsAll(expected.asJava)
  }

